import { useEffect, useRef } from 'react';
import { gsap } from 'gsap';

const CanvasComponent = ({ scrollY }) => {
  const canvasRef = useRef(null);

  useEffect(() => {
    if (typeof window !== 'undefined') {
      const canvas = canvasRef.current;
      const ctx = canvas.getContext('2d');
      const svgImage = new Image();

      svgImage.src = 'data:image/svg+xml;base64,';  // Ensure this path is correct

      svgImage.onload = () => {
        ctx.drawImage(svgImage, 0, 0, canvas.width, canvas.height);
      };

      // Scroll-triggered scaling using GSAP
      const updateCanvas = () => {
        const scale = gsap.utils.mapRange(0, 4000, 70, 1, scrollY.get());
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        ctx.save();
        ctx.scale(scale, scale);
        ctx.drawImage(svgImage, 0, 0, canvas.width, canvas.height);
        ctx.restore();
      };

      const unsubscribe = scrollY.onChange(updateCanvas);
      return () => unsubscribe();
    }
  }, [scrollY]);

  return (
    <canvas
      ref={canvasRef}
      width={typeof window !== 'undefined' ? window.innerWidth : 0}
      height={typeof window !== 'undefined' ? window.innerHeight : 0}
      style={{
        position: 'fixed',
        top: 0,
        left: 0,
        width: '100%',
        height: '100%',
      }}
    />
  );
};

export default CanvasComponent;
